import Button from 'react-bootstrap/Button';
import { useNavigate } from 'react-router-dom';
import { auth, provider} from '../../configs/firebaseConfig';
import { useEffect } from "react";
import '../../css/App.css';
import Footer from '../../components/Footer';

const Login = () => {
  let navigate = useNavigate();
  var gender;
  var age;
  var userData = undefined;

  useEffect(() => { 
    document.getElementById('Login-button').disabled = true;
    if(sessionStorage.getItem('ageAndGenderData') == null) {
      userData = ["",""];
      window.sessionStorage.setItem('ageAndGenderData', JSON.stringify(userData));
    }
    else {
      userData = JSON.parse(window.sessionStorage.getItem('ageAndGenderData'));
    }
  },[])

  async function signInWithGoogle() {
    auth
      .signInWithPopup(provider)
      .then((res) => {
      ;
          navigate("/home");
      })
      .catch((error) => {
        console.log(error);
      });

    }

  function saveData() {
    userData[0] = age;
    userData[1] = gender;
    window.sessionStorage.setItem('ageAndGenderData', JSON.stringify(userData)); 
  }

  return (
    <div id="Login" style={{paddingTop: "54px"}}>
      <div className="main-container">
          <div className="container">
            <div className="content" style={{width: "75%"}}>
              <div>
                <h1 style={{paddingTop: "30px"}}>Välkommen till vår enkät om Explainable AI</h1>
                <br></br>
                <p>Du behöver inte ha några förkunskaper inom AI (Artificiell Intelligens) för att utföra enkäten. Enkäten syftar till att utforska vilka likheter och skillnader som finns mellan mänsklig klassificering av visuella objekt och Explainable AI-metoder.</p>
                <p>Explainable AI är ett område med fokus på mänsklig insyn i AI-modellers beslutsfattande och funktionalitet. Målet är att skapa mänsklig förståelse för vad som påverkade en AI:s beslut och hur. Detta görs genom algoritmer som retroaktivt, när AI-modellen är färdig att användas, försöker lista ut vad som prioriteras vid dess beslutsfattande. Många metoder för detta finns, men de som undersöks här baseras på att man på olika sätt manipulerar delar av in-datan och observerar hur det förändrar beslutet.
                  retroaktivt försöker lista ut hur det fattar sina beslut.</p>
                <br></br>
                <p>Vårt mål är att undersöka likheter och skillnader i vad de olika Explainable AI-algoritmerna påvisar är de viktigaste aspekterna vid klassificering för en AI-modell och jämföra detta med vad människor prioriterar när de identifierar objekt. På detta sätt kan vi hitta eventuella mönster som kan antyda vilka Explainable AI-metoder som är mest lika mänskligt resonerande och utifrån detta undersöka om just dessa metoder är mer givande för att öka människors förståelse för en AI-modell.</p>
                <br>
                </br>
                <h6>Den enda data som sparas är dina enkätsvar, vilka är anonyma.
                  <br>
                  </br>
                  Enkäten tar ca <u>10</u> minuter att genomföra.
                  <br>
                  </br>
                  <br>
                  </br>
                  Stort tack för din tid.
                </h6>
                <br>
                </br>  
                <label>Ålder</label>
                <br>
                </br>
                <select id="age" style={{width: "150px"}} onChange={ () => {
                   var radioButtons = document.getElementsByTagName('genderCheck');
                   var consent = document.getElementById("consent")
                   age = document.getElementById('age').value;
               
                   for (var i = 0; i < radioButtons.length; i++) {
                     if (radioButtons[i].type === 'radio' && radioButtons[i].checked) {
                         gender = radioButtons[i].value;   
                     }
                   }
                   if(gender != "" && age != "" && consent.checked) {
                     document.getElementById("Login-button").disabled = false;
                   }
                   else {
                     document.getElementById("Login-button").disabled = true;   
                   }
                }}> 
                  <option value="" hidden>Välj din ålder</option>
                  <option value="<25" style={{textAlign: "left"}}>Under 25</option>
                  <option value="25-39" style={{textAlign: "left"}}>25-39</option>
                  <option value="39-40" style={{textAlign: "left"}}>40-60</option>   
                  <option value="60+" style={{textAlign: "left"}}>60+</option>     
                </select>             
                <br>
                </br>  
                <br>
                </br>
                <label>Kön</label>
                <br>
                </br>
                <input type="radio" id="male" value="male" name="genderCheck" onClick={ () => {
                   var radioButtons = document.getElementsByTagName('genderCheck');
                   var consent = document.getElementById("consent")
                   age = document.getElementById('age').value;
               
                   for (var i = 0; i < radioButtons.length; i++) {
                     if (radioButtons[i].type === 'radio' && radioButtons[i].checked) {
                         gender = radioButtons[i].value;   
                     }
                   }
                   if(gender != "" && age != "" && consent.checked) {
                     document.getElementById("Login-button").disabled = false;
                   }
                   else {
                     document.getElementById("Login-button").disabled = true;   
                   }
                }}>

                </input>
                <label>man</label>
                <input type="radio" id="female" value="female" name="genderCheck" onClick={ () => {
                   var radioButtons = document.getElementsByTagName('genderCheck');
                   var consent = document.getElementById("consent")
                   age = document.getElementById('age').value;
               
                   for (var i = 0; i < radioButtons.length; i++) {
                     if (radioButtons[i].type === 'radio' && radioButtons[i].checked) {
                         gender = radioButtons[i].value;   
                     }
                   }
                   if(gender != "" && age != "" && consent.checked) {
                     document.getElementById("Login-button").disabled = false;
                   }
                   else {
                     document.getElementById("Login-button").disabled = true;   
                   }
                }}>

                </input>
                <label>kvinna</label>
                <input type="radio" id="other" value="other" name="genderCheck" onClick={ () => {
                   var radioButtons = document.getElementsByTagName('genderCheck');
                   var consent = document.getElementById("consent")
                   age = document.getElementById('age').value;
               
                   for (var i = 0; i < radioButtons.length; i++) {
                     if (radioButtons[i].type === 'radio' && radioButtons[i].checked) {
                         gender = radioButtons[i].value;   
                     }
                   }
                   if(gender != "" && age != "" && consent.checked) {
                     document.getElementById("Login-button").disabled = false;
                   }
                   else {
                     document.getElementById("Login-button").disabled = true;   
                   }
                }}>

                </input>
                <label>annat</label>
                <br>
                </br>  
                <br>
                </br> 
                <input type="checkbox" id="consent" onClick={ () => {
                   var radioButtons = document.getElementsByTagName('genderCheck');
                   var consent = document.getElementById("consent")
                   age = document.getElementById('age').value;
               
                   for (var i = 0; i < radioButtons.length; i++) {
                     if (radioButtons[i].type === 'radio' && radioButtons[i].checked) {
                         gender = radioButtons[i].value;   
                     }
                   }
                   if(gender != "" && age != "" && consent.checked) {
                     document.getElementById("Login-button").disabled = false;
                   }
                   else {
                     document.getElementById("Login-button").disabled = true;   
                   }
                }}>            
                </input>
                <label style={{display: "inline", marginLeft: "5px"}}>
                  <i>
                  Jag har tagit del av informationen ovan och samtycker till att delta. Jag är	medveten om att mitt deltagande är helt frivilligt och att	jag kan avbryta mitt deltagande i studien utan att ange något skäl.
                  </i>
                  </label>
                <br>
                </br>
              </div>
              <Button id="Login-button" style={{ marginTop: "20px"}} variant="outline-secondary" onClick={ () => {
                saveData();
                signInWithGoogle();
              }}
              >
                Logga in med Google
              </Button>      
            </div> 
            <Footer/>
          </div>               
      </div>
    </div>
  )
}

export default Login;
